div.div:
if nextBrightness != null:
prevBrightness = lightBulb.brightness
lightBulb.brightness = nextBrightness
if nextColor != null:
prevColor = lightBulb.color
lightBulb.color = nextColor

if prevBrightness != null:
lightBulb.brightness = prevBrightness
if prevColor != null:
lightBulb.color = prevColor

person.on('awake', () => {
home.setWorkingLighting()
})
person.on('beforeasleep', () => {
home.setRelaxingLighting()
person.once('coffee', () => {
home.returnToLastScene()
})
})
